import React, { useState } from "react";
import GlobalStyle from "../theme/globalstyles";
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import UserContext from "../contexts/UserContext";
import Login from "./Login";
import Register from "./Register";
import InitalPage from "./InitialPage";
import AddRegister from "./AddRegister";
import RemoveRegister from "./RemoveRegister";

export default function App() {
  const [user, setUser] = useState();
  const userContext = {
    user,
    setUser
  }
  return (
    <BrowserRouter>
      <GlobalStyle />
      <UserContext.Provider value={userContext}></UserContext.Provider>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/initialpage" element={<InitalPage />} />
          <Route path="/add" element={<AddRegister />} />
          <Route path="/remove" element={<RemoveRegister />} />
        </Routes>
    </BrowserRouter>
  );
}
